import React from "react";
import ReactDOM from "react-dom";
import { add, sub, mult, div } from "./App";
ReactDOM.render(
  <>
    <ul>
      <li>Sum = {add(10, 10)}</li>
      <li>Sub = {sub(20, 10)}</li>
      <li>div = {div(2, 10000)}</li>
      <li>Product = {mult(10, 10)}</li>
    </ul>
  </>,
  document.getElementById("root")
);
